* [[Tar-Aldarion|Aldarion]] leaves [[Númenor]] on his third voyage to [[Middle-earth]]. No longer satisfied just to visit [[Grey Havens|Mithlond]], Aldarion also explores the coasts southwards past the mouths of the rivers [[Baranduin]], [[Gwathló]] and [[Isen]], rounding [[Andrast]] to visit the [[Bay of Belfalas]] and to see the mountains in the country of Amroth.<ref name="Aldarion">{{UT|Aldarion}}, first pages</ref><ref group=note>The year when Aldarion left Númenor for his third voyage is calculated backwards based on the statements that he was born in the year 700, that the voyage lasted for four years and that he returned to Númenor in the thirty-ninth year of his age.</ref>

